import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
    return (
        <header className="bg-zinc-700 text-white p-4 shadow-md">
            <div className="container mx-auto flex justify-between items-center">
                <div className="flex items-center">
                    {/* Placeholder for a logo if you have one */}
                    <div className="my-1 mr-6">
                    <h1 className="font-bold text-2xl text-left">Kittler</h1>
                    <h2 className="italic text-left">switch off all apparatuses.</h2>
                    </div>
                </div>
                <nav className="flex items-center">
                    <Link to="/" className="inline-block p-2 font-bold hover:text-slate-400 stroke-widthtransition-colors duration-300">
                      <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" class="w-6 h-6">
                        <path stroke-linecap="round" stroke-linejoin="round" d="m2.25 12 8.954-8.955c.44-.439 1.152-.439 1.591 0L21.75 12M4.5 9.75v10.125c0 .621.504 1.125 1.125 1.125H9.75v-4.875c0-.621.504-1.125 1.125-1.125h2.25c.621 0 1.125.504 1.125 1.125V21h4.125c.621 0 1.125-.504 1.125-1.125V9.75M8.25 21h8.25" />
                      </svg>
                    </Link>
                    {/* Sign In and Register Buttons */}
                    <Link to="/login" className="btn shadow-[0_9px_0_rgb(0,0,0)] hover:shadow-[0_4px_0px_rgb(0,0,0)] hover:translate-y-1 transition-all inline-block p-2 ml-4 bg-stone-400 text-white hover:bg-neutral-300 transition-colors duration-300 font-semibold rounded">Login</Link>
                    <Link to="/signup" className="btn shadow-[0_9px_0_rgb(0,0,0)] hover:shadow-[0_4px_0px_rgb(0,0,0)] hover:translate-y-1 transition-all inline-block p-2 ml-4 bg-stone-500 hover:bg-neutral-400 transition-colors duration-300 font-semibold rounded">Register</Link>
                </nav>
            </div>
        </header>
    );
} 

export default Header;
